dari Vaksinasi Gotorng Royong itu. #DiBalikLiputan #VaksinBerbayar','akhir pada jumat pekan presiden joko widodo batal program turun vaksinasi gotorng royong','temponewsroom','2021-07-21 09:16:53','NONHS'),(1417775990567150080,'Gagasan vaksinasi berbayar sesungguhnya bukan hal baru. Pada Oktober 2020, Jokowi menyatakan bahwa tidak semua vaksin gratis, dan ada yang berbayar. #DiBalikLiputan #VaksinBerbayar','gagas vaksinasi bayar sungguh baru pada oktober jokowi nyata tidak semua vaksin gratis bayar','temponewsroom','2021-07-21 09:18:31','NONHS'),(1417776361482046976,'Baru sekitar dua bulan kemudian, juga setelah mendapat kritik dari berbagai penjuru, Presiden memutuskan vaksinasi gratis untuk semua. Aroma tak sedap dalam program vaksinasi berbayar pun meruap. #DiBalikLiputan #VaksinBerbayar','baru dua telah dapat kritik bagai penjuru presiden putus vaksinasi gratis semua aroma tidak sedap dalam program vaksinasi bayar meruap','temponewsroom','2021-07-21 09:20:00','NONHS'),(1417776758535770112,'Wartawan majalah ini mendapatkan sejumlah informasi bahwa ada pihak-pihak yang ingin mendulang cuan di tengah amukan Covid-19. #DiBalikLiputan #VaksinBerbayar','wartawan majalah dapat jumlah informasi pihakpihak ingin dulang cuan tengah amuk covid','temponewsroom','2021-07-21 09:21:34','HS'),(1417777314121715968,'Kami pun menelusuri bagaimana kebijakan vaksinasi berbayar diambil oleh pemerintah. Sejumlah narasumber yang mengetahui pembahasan vaksinasi berbayar bercerita bahwa terjadi perpecahan di dalam kabinet. #DiBalikLiputan #VaksinBerbayar','telusur bijak vaksinasi bayar ambil oleh perintah jumlah narasumber tahu bahas vaksinasi bayar cerita jadi pecah dalam kabinet','temponewsroom','2021-07-21 09:23:47','NONHS'),(1417777609279115008,'Menteri Kesehatan Budi Gunadi Sadikin disebut-sebut tidak mendukung vaksinasi berbayar untuk individu. Namun, ada pula pejabat lain yang mendukung rencana itu. #DiBalikLiputan #VaksinBerbayar','menteri sehat budi gunadi sadikin disebutsebut t